  \"survey-of-organophosphate-insecticides-in-wetlands-near-sunflower-fields-in-south-dakota\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Prairie Pothole region of North America
  contains the most productive waterfowl habitat on the continent. The region also
  supports intensive agricultural activity that includes routine application of agricultural
  chemicals to most crops. Insecticides are used mainly on sunflowers, and sunflower
  acreage in South Dakota has increased more than three-fold since 1990. Parathion
  is the primary insecticide used on sunflowers and most of it is applied by aerial
  spraying. Wetlands adjacent to, or encompassed by, sunflower fields are at risk
  for receiving parathion. Results from the present study suggest that standing water
  in approximately 25% of the wetlands may contain measurable amounts of parathion.
  The potential risk to aquatic organisms in wetlands adjacent to sunflower fields
  is probably underestimated by this study because the detection limit for parathion
  exceeds the acute limit for the EPA's National Criteria for protection of freshwater
  organisms. Further study is warranted and should include more sensitive analyses
  and more attention to factors such as time since last spraying, proximity to sprayed
  fields, and persistence of parathion in natural wetlands.\",\n\t\"license_title\":
